/* eslint-disable */console.log($("#TestNav"));const darkSwitch=document.getElementById("darkSwitch");function initTheme(){const e=null!==localStorage.getItem("darkSwitch")&&"dark"===localStorage.getItem("darkSwitch");darkSwitch.checked=e,e?document.getElementById("TestNav").setAttribute("data-theme","dark"):document.getElementById("TestNav").removeAttribute("data-theme")}function resetTheme(){darkSwitch.checked?(document.getElementById("TestNav").setAttribute("data-theme","dark"),localStorage.setItem("darkSwitch","dark")):(document.getElementById("TestNav").removeAttribute("data-theme"),localStorage.removeItem("darkSwitch"))}window.addEventListener("load",()=>{darkSwitch&&(initTheme(),darkSwitch.addEventListener("change",()=>{resetTheme()}))});